import React from "react";
import BackButton from "./Buttons/BackButton";
import Zoom from "@material-ui/core/Zoom";
import UpButton from "./Buttons/UpButton"
import { MainDiv, StyledPaper, Text} from "./styles/ContentPages"
import { ProjectPaper, TextDiv, ProjectTitle, ProjectText} from "./styles/Projects"

export default function Bio(props) {
  return (
    <MainDiv>
      <BackButton onClick={() => props.transition("MENU")} />
      <Zoom in={true}>
        <StyledPaper>
          <ProjectPaper elevation={12}>
            <TextDiv>
              <ProjectTitle>TECHNICAL SKILLS</ProjectTitle>
              <ProjectText>
                TECH SKILLS HERE
      </ProjectText>
            </TextDiv>
          </ProjectPaper>

          <UpButton onClick={() => props.scrollUp()}/>
        </StyledPaper>
      </Zoom>

    </MainDiv>
  );
}
